var dgloader = [];

var Loading = cc.Scene.extend({
    _className: "Loading",
    _label: null,
    cb: null,
    target: null,
    init: function () {
        var self = this;

        // logo image
        var logoImage = 'data:image/ico;base64,';

        // bg
        var bgLayer = new cc.LayerColor(cc.color(0, 0, 0, 255));
        self.addChild(bgLayer, 0);

        //loading logo
        cc.loader.loadImg(logoImage, {isCrossOrigin: false}, function (err, img) {
            var texture2d = new cc.Texture2D();
            texture2d.initWithElement(img);
            texture2d.handleLoadedTexture();

//            var logo = cc.Sprite.create(texture2d, cc.rect(200, 0, 50, 50));
            var logo = cc.Sprite.create(texture2d);
            logo.setScale(cc.contentScaleFactor());
            logo.setPosition(cc.visibleRect.center);
            bgLayer.addChild(logo, 10);

//            // logo animation
//            var frames = [];
//            for (var idx = 0; idx < 5; idx++) {
//                frames.push(cc.SpriteFrame.create(texture2d, cc.rect(200 - idx * 50, 0, 50, 50)));
//            }
//            var animation = new cc.Animation(frames, 0.1);
//            var animate = cc.animate(animation);
//            logo.runAction(animate.repeatForever());

            // loading percent label
            var label = new cc.LabelTTF("加载中... 0%", "Arial", 24.0);
            label.setPosition(cc.pAdd(cc.visibleRect.center, cc.p(0, -200)));
            label.setColor(cc.color(255, 255, 255));
            bgLayer.addChild(label, 10);

            self._label = label;
        });

        return true;
    },

    initWithResources: function (resources, cb, target) {
        if (cc.isString(resources)) {
            resources = [resources];
        }
        this.resources = resources || [];
        this.cb = cb;
        this.target = target;
    },

    onEnter: function () {
        cc.Node.prototype.onEnter.call(this);
        this.schedule(this._startLoading, 0.3);
    },

    _startLoading: function () {
        var self = this;
        self.unschedule(self._startLoading);
        var res = self.resources;
        cc.loader.load(res,
            function (result, count, loadedCount) {
                var percent = (loadedCount / count * 100) | 0;
                percent = Math.min(percent, 100);
                self._label.setString("加载中... " + percent + "%");
            }, function () {
                if (self.cb) {
                    self.cb.call(self.target);
                }
            });
    }
})
;

Loading.preload = function (resources, cb, target) {
    var loader = dgloader;
    if (!loader.loaderScene) {
        loader.loaderScene = new Loading();
        loader.loaderScene.init();
    }
    loader.loaderScene.initWithResources(resources, cb, target);
    cc.director.runScene(loader.loaderScene);
    return loader.loaderScene;
};
